    const options = {
        items: 5,
        loop: true,
        nav: true,
        autoplay:true
    };

    return (
        <OwlCarousel className="owl-theme" {...options}>
            <div className="item">
                <div className='card'>
                <h4>Lahore</h4>
                </div>

            </div>
        </OwlCarousel>
    );
}

export default CitiesListSlider;
